function Netflix(){
    return(
        <div className="card">
        <img
            src="https://i.imgur.com/KgRmElg.png"
            alt="Dark"
        />
        <div>
        <span>Trending Netflix Series</span>
        </div>
        <h1>Dark</h1>
        </div>
    );
}

export default Netflix;
